import React from 'react';
import './About.css'
import { Link } from "react-router-dom";

function About() {
return ( 
    <div className="about">
       <Link to="/about">
          <img className="login_logo" src="logo1.png" width="140" height="140" alt="logo1" />
       </Link>
       <div className="">
     <h3>About</h3>
       </div>
    </div>
);
}
export default About;
